('רואי', 'זילברמן', 'roeyzil@gmail.com', '0526033777', '2022', '{"age":29,"gender":"זכר","livingArea":"שפיים","careerStage":"שירתתי כלוחם בשירות קבע בסיירת מטכל.\nבוגר תואר ראשון (2018-2021) בתוכנית המצטיינים פכ\"מ באוניברסיטת ת\"א (פילוסופיה, כלכלה ומדעי המדינה).\nבמשך שנה וחצי עבדתי בחברת הייעוץ והמחקר TARA, כאנליסט מחקר, ובהמשך כמוביל מחקר ומנהל פרויקטים. \n\nאני נמצא היום בצומת משמעותית, בתחילת הדרך המקצועית שלי, ומתמודד עם הרבה התלבטויות והחלטות בתחום המקצועי. לכן אני פתוח וסקרן לרכוש כלים ומיומנויות שיסייעו לי בהמשך.\nיש לי רצון להוביל מהלכים משמעותיים בחברה שלנו, ולעסוק בתחומים בעלי אימפקט משמעותי לחברה ולסביבה. אני \"שחקן צוות\" והייתי רוצה להשתפר ביכולת להניע אנשים ופרויקטים קדימה יחד איתי.\n\nהייתי שמח לקבל מהתוכנית כלים להתנהלות מקצועית ואישית שישרתו אותי בהמשך הדרך.\nשמעתי המלצות מבוגרי היחידה על התוכנית, והייתי שמח מאד לקחת בה חלק.","workType":"בין עבודות","globalOrIsrael":"ישראל","birthYear":1996}'::jsonb, ARRAY['PIF', 'צה\"ל - יחידה עילית', 'מטכל', 'מחזור 2022']::text[]),
('ראם', 'זר', 'reeemzer@gmail.com', '0506979522', '2022', '{"age":29,"gender":"זכר","livingArea":"נופי פרת,21","careerStage":"את השירות הסדיר בצבא עשיתי כלוחם בסיירת מטכל, לאחר 3 שנים כאשר הצוות שלי עמד להשתחרר החלטתי שאני ורצה להמשיך לתרום ולהתפתח במערכת הצבאית. \nיצאתי לקורס קצינים ועברתי לגדוד 12בחטיבת גולני, שם התקדמתי בהצטיינות עד לתפקיד מ\"פ לוחמים בגדוד. תפקיד, שלדעתי, הוא המעניין והמאתגר שיש ברשות צהל להציע לפיקוד הזוטר.\n\nלאחר השחרור לקחתי חלק בהקמת ''מועדון המ\"פים 2141'' - עמותה שנועדה לעזור למ\"פים קרביים עם שחרורם להשתלב בשוק האזרחי ולקדם את אותם מנהיגים ציוניים וערכיים לעמדות מפתח בתעשייה, בשלטון ובהייטק הישראלי.\nבמקביל לעבודתי במועדון כאחראי על הפיתוח העסקי אני מלומד תואר ראשון במדמ\"ח בפתוחה.\n\nאני מביא איתי לתכנית סקרנות רבה, סקרנות ללמוד ולהתפתח.\nבתקופה הארחונה הנמצא במעיין צומת משמעותית בחיי המקצועיים. אשמח לנצל את הפלטפורמה ללמידה על עצמי, לדיוק הרצונות.\nארצה לרכוש כלים ניהוליים ולהרחיב את הדעת בנושאים חברתיים ומקצועיים.","workType":"VP of BisDev במועדון 2141, עמותה של אקס מפים","globalOrIsrael":"ישראל","birthYear":1996}'::jsonb, ARRAY['PIF', 'צה\"ל - יחידה עילית', 'מטכל', 'מחזור 2022']::text[]),
