('אור', 'שלם', 'orshalem1@gmail.com', '0528047047', '2022', '{"age":29,"gender":"זכר","livingArea":"תל אביב","careerStage":"אני אור שלם, בן 29, נשוי טרי לספיר. נולדתי בירושלים וגדלתי בשכונת בית הכרם. למדתי בתיכון ליד\"ה והייתי חניך מדריך ומרכז בשבט הצופים בשכונה. כמו כן, יצאתי למשלחת של הצופים בארה\"ב למשך שלושה חודשים בקהילות יהודיות במדינה. בנוסף, שחקתי כדורסל במחלקת הנוער של הפועל ירושלים. לאורך כל שנות התיכון, הייתי פעיל מאוד לצד הלימודים בפעילות חברתית וספורטיבית במסגרת התנועה וקבוצות הספורט אליהן השתייכתי. אין לי ספק כי פעילויות אלו עצבו אותי מאוד. לאחר סיום התיכון, יצאתי לשנת שירות של הסוכנות היהודית במסגרת תכנית שליחות צעירה בקהילה יהודית בטורונטו, קנדה. במהלך השנה, יזמתי והוצאתי לפועל מערכי חינוך והסברה בקהילה בה התנדבתי, לקחתי חלק בפעולות הסברה בקמפוסים באוניברסיטאות בעיר, ויצאתי להדריך במחנה קיץ של תנועת Canadian Young Judaea. שנה זאת סייעה לי לפתח עצמאות ומסוגלות עצמית, כמו גם עמדות ודעות בנושאים ערכיים וחבריים שונים. \nלאחר החזרה מהשנת שירות התגייסתי למערך המ\"מ כמש\"ק מודיעין. לאחר מספר שנים יצאתי לקורס קצינים, ובצעתי תפקידים מודיעיניים פיקודיים, במסגרתם יזמתי והובלתי פרויקטים מודיעיניים-טכנולוגיים שונים. לאחר מספר שנים יצאתי לפקד על השלמת הקצונה במגמה של מערך המ\"מ, תפקיד הדרכתי שכלל הכשרה פיקודית של עשרות צוערים. לאחר סיום התפקיד, הגעתי ליחידה נוספת במערך, בה שמשתי כסגן של קצין המודיעין של היחידה. במסגרת התפקיד, הובלתי פרויקטים מודיעיניים-מבצעיים, יזמתי הכשרות חדשות במחלקת המודיעין של היחידה והייתי חלק ממחלקת פיתוח היעדים ביחידה. במסגרת התפקידים השונים שבצעתי, פיקוד על חיילים תמיד היווה את אחד מגורמי ההנעה המשמעותיים ביותר עבורי. אני רואה בפיקוד זכות ענקית, ופוטנציאל להשפיע לחיוב על חייהם של אנשים. \nבמהלך השירות ביחידה לאחר פרוץ מגפת הקורונה, יצא לי לקחת חלק בפעילות של מרכז השליטה הארצי של משרד הביטחון, שהוקם בבית הסובב עולםים שיבא. במסגרת ההתנדבות במרכז, הייתי אמון על הפעלת רשת שליחים בבתי הסובב עולםים של קופ\"ח כללית, תוך ניסיון לקדם רכש ופרויקטים שיסייעו להם לתפקד בתקופה מורכבת זאת. מדובר בחוויה ייחודית שטמנה בחובה התמודדות במצבי אי וודאות ולחץ כללי, שאפיינו את אותה התקופה (ביתר שאת בבתי הסובב עולםים). אמנם מדובר בחוויה קצרה וממוקדת, אך מיוחדת ומלמדת מאוד.\nלאחר סיום התפקיד יצאתי ללימודים במסגרת תכנית שירות של אמ\"ן, והתחלתי ללמוד פסיכולוגיה באוניברסיטת רייכמן. בחרתי בלימודי פסיכולוגיה מתוך רצון לפתח כישורי מנהיגות והובלה, מתוך הבנה עמוקה יותר של האדם, ורכישת גישות מחשבה משדה מקצועי זה. במסגרת הלימודים, לקחתי חלק בתכנית רבין למנהיגות של האלוף ייה, תכנית אשר במסגרתה יוזמים פרויקט חברתי, נחשפים למיזמים חברתיים ברחבי המדינה ולומדים על גישות מנהיגותיות שונות. בנוסף, התמחתי כאנליסט ב-VC בבנייה שעתיד להשקיע במיזמים של טכנולוגיות אקלים. בשנה האחרונה, עבדתי במחלקת מחקר ופיתוח עסקי של קבוצת סטרט-אפים בעולם ה-Fintech. במסגרת העבודה, ניהלתי צוות שחקר ופיתח הזדמנויות עסקיות שונות בעבור החברה. מדובר בהתנסות מעניינת ומשמעותית מאוד שהקנתה לי שפה וכישורים חדשים בעולם העסקי.  \nבשנה הבאה, אני עתיד לקחת חלק במסגרת הלימודים בהתנסות בליווי פסיכולוגי בפנימייה של נוער בסיכון במרכז הארץ. כמו כן, בסוף השנה אני עתיד לסיים את לימודי. אציין כי אני צפוי לחזור לשירות בתום הלימודים, ולהתמודד על תפקידים מודיעיניים פיקודיים משמעותיים במערך המ\"מ. \nלאור החוויות השונות שעברתי ואת חלקן הצגתי לעיל, אני סבור כי אני בעל אופי יזמי, עם מוטיבציה פנימית גבוהה ללמוד ולפתח את עצמי. כמו כן, חשוב לי לייצר אימפקט חיובי על אנשים ומסגרות שונות בהם אני לוקח חלק, דבר הבא לידי ביטוי בתכניות בהם אני בוחר להשתתף ובתפקידים הפיקודיים השונים אותם בחרתי לבצע. אני תופס את עצמי כאדם חרוץ בעל חדוות עשייה גבוהה, אשר משתדל לא להסתכל מהצד על דברים שמפריעים לו, אלא פועל לשיפור או שינוי הקיים. תכונות אלו הן חלק מתפיסת עולם של אופטימיות, תכונה משמעותית מאוד בעייני שמובילה אותי ביום יום. \nלהבנתי, התכנית שואפת להקנות סט כלים מנהיגותי, תוך שימת דגש על כלים אישיים הדורשים הסתכלות פנימית עמוקה ומשמעותית, דבר יחסית נדיר בתכניות מנהיגות אחרות. גם אם מדובר בתקופה יחסית קצרה, אני חושב כי מדובר בהזדמנות נדירה לעבור את התהליך הנ\"ל ולספוג כלים מקצועיים וגישות מחשבה שיתרמו לפיתוח הדמות המנהיגותית שלי, אשר נמצאת בתנועה כל הזמן. כאמור, יש בי רעב מתמיד ללמוד ולהשקיע בפיתוח אישי, כדי לבנות דמות חקה יותר שתוכל להשפיע בחזרה על הסביבה. אני חושב שהופמן קופמן מהווה הזדמנות מעולה לחיזוק הדמות הזאת, בצורה ייחודית ומקצועית.","workType":"סטודנט לתואר ראשון בפסיכולוגיה באוניברסיטת רייכמן, במסגרת תכנית שירות של הצבא","globalOrIsrael":"ישראל","birthYear":1996}'::jsonb, ARRAY['PIF', 'עמותת יחידה', 'המעלה ה12', 'מחזור 2022']::text[]),
