('דניאל', 'רוטנברג', 'r.danielle805@gmail.com', '0525221277', '2022', '{"age":26,"gender":"נקבה","livingArea":"רעננה","careerStage":"נולדתי בארצות הברית ועשיתי עלייה עם המשפחה בגיל שמונה לארץ. הייתי בצבא ארבע וחצי שנים בהם השתתפתי בפרויקטים מאוד מורכבים ומעניינים בתפקידים ניהוליים עם הרבה אחריות. בפרויקט הכי גדול שהשתתפתי בו, הייתי צריכה להתנהל בתנאים של לחץ וסביבה משתנה עם יכולה למידה, קבלת החלטות עם שיקול דעת ויכולות בינאישיות גבוהות עם מגוון אנשים. פרויקט זה קיבל את פרס ראש הממשלה וצל״ש הרמטכ״ל. \nהיה לי שירות מאוד משמעותי ומספק. בסופו, הציעו לי תוכנית שירות עם משכורת מאוד גבוהה ותנאים מאוד מפתים להישאר עוד כמה שנים אבל החלטתי לסרב בכדי לחפש את מקומי המדוייק יותר בעולם.\n\nהשתחררתי וטיילתי בכל מיני מקומות מופלאים ומטורפים בעולם בערך חצי שנה. כשחזרתי ארצה עברתי לתל אביב והתחלתי לעבוד כמנהלת פרויקטים בחברת תיירות \"Tourist Israel\". עבדתי צמוד למנכ״ל ולסמנכ״לית, בתפקיד שמנהל הרבה עובדים ומפתח צירים בחברה. תוך כדי העבודה, פיתרו את הסמנכ״לית ובגדול העבירו אליי את כל האחרויות שלה. מהר מאוד הייתי חלק מההנהלה של החברה. על הנייר היה לי את עבודת החלומות - מיקום מדהים, שכר מעולה, תנאים טובים, אווירה צעירה וכיפית במשרד - אבל היה חסר תחושת שייכות למשהו גדול יותר בעולם. עם תחילת הקורונה, עזבתי את החברה אחר חיפוש עיסוק עם יותר משמעות. בזמן הזה עשיתי כל מיני הכשרות להיות מורה ליוגה ופתחתי סטודיו / עסק משלי שבו לימדתי פעמיים ביום שיעורי יוגה.\n\nדרך היוגה הצלחתי לקחת את העבודה העצמית וההתקדמות בחיים ולשים אותה על המזרן כדי תמיד להיות בתנועה. ההוראה ביוגה הייתה דרך להגיע אל אנשים ולעזור להם לעצור את חיי היומיום שלהם, לחשוב על איפה הם נמצאים מול עצמם ולצעוד את הצעדים שלהם בחיים.\n\nלפני כשנתיים, הגיעה אליי משרה של עבודה בארגון הומניטרי שלא יכולתי לסרב מרוב שהרגשתי שהיא מתאימה לי. אני עד היום עובדת בעמותת ״הצל ליבו של ילד״ שבו אנחנו מביאים ילדים מכל העולם שאין להם גישה לקרדיולוגיה במדינות המוצא שלהם, לקבל ניתוחי לב מצילי חיים פה בארץ. בעמותה אני עושה תפקיד ניהולי המשלב עבודה עם הלב וגם עם המוח, המאתגר אותי בצורה חיובית בשני המובנים ואני מצליחה לשלב את העבודה בעמותה והעיסוק בחיי היוגה בצורה מאוד יפה.\n\nלאורך חיי,  בכל מסגרת שהגעתי אליה,  מהר מאוד הגעתי לתפקיד ניהולי/ הנהגתי עם הרבה אחריות והרבה אינטרקציות עם אנשים. נושאי הלימוד בתוכנית pay it forward הם תחומים בהם נגעתי הרבה, בין אם בצורה פורמאלית או לא. הם כולם תחומים בהם אני מאמינה ונותנת הרבה מקום וערך בעיסוקיים האישיים שלי. אני מאמינה שכל חיי אהיה בתפקידים מהסוג הזה ומאד הייתי רוצה לקבל יותר כלים מקצועיים, נכונים והוליסטים להיות ״מנהיגה״ בווריאציה הכי טובה שלי.","workType":"עובדת עם ילדים סובב עולםי לב בעמותת ״הצל ליבו של ילד״ ומתעסקת ביוגה","globalOrIsrael":"ישראל","birthYear":1999}'::jsonb, ARRAY['PIF', 'עמותה יחידה', 'המעלה ה12', 'מחזור 2022']::text[]),
