('אושר', 'חודוס', 'osherhd7@gmail.com', '0545421966', '2022', '{"age":24,"gender":"זכר","livingArea":"באר שבע","careerStage":"אושר חודוס, בן 24. כרגע גר בתל אביב ועתיד לעבור בחודשים הקרובים לבאר שבע לטובת התחלת תואר ראשון באוניברסיטת בן גוריון. מתחיל תואר דו חוגי בפסיכולוגיה - מדעי הקוגניציה והמח. \nהשתחררתי מהשירות הצבאי בינואר האחרון, בתור סרן, לאחר 5 שנים של שירות.\nהתגייסתי לתפקיד לוחם ביחידה בחיל המודיעין.עברתי תהליך הכשרה במשך שנתיים, ולאחריו ביצעתי מספר תפקידים מבצעיים ופיקודיים מורכבים.\n\nחינוך והדרכה הינו חלק משמעותי מחיי. במהלך התיכון הייתי פעיל בתנועת הצופים, יצאתי כשליח מטעם התנועה בכיתה יא לחודשיים של הדרכה במחנה יהודי רפורמי, ומאז הדבר נוכח מאוד בחיי. בשירותי ביחידה קידמתי פרוייקטים מחוץ למסגרת תפקידי שמטרתם הייתה לשפר את כניסתם לפלגה של לוחמים חדשים לאחר סיום מסלולם. לאחר השחרור מהיחידה, חזרתי לעסוק בהדרכה ובימים אלה אני בתפקיד ראש הצופים במחנה יהודי במדינת מסצ׳וסטס בארה״ב.\n\nבנוסף, פועל יחד עם עמותת ״לחיות בכבוד״ בהתנדבות, גיוס מתנדבים חדשים וגיוס כספים לעמותה דרך הרשתות החברתיות. \n\nאני מאוד מתעניין בפילוסופיה בודהיסטית ומיינדפולנס. מתרגל בין 20 ל 30 דקות מדיטציה ביום. אחת הסיבות שהחלטתי ללמוד את התואר שאני מתחיל השנה היא עניין רב במח האנושי וברצון שלי להקל על סבלם של אנשים. \n\nבנוסף, ספורט הינו חלק משמעותי בחיי. אני עוסק בפעילות ספורטיבית מגיל מאוד צעיר. החל מכדורסל, אגרוף תילאנדי, גלישת גלים, יוגה, אימוני אתלטיקה וחדר כושר. אני מאמין שספורט ואורח חיים בריא הינם מרכיבים קריטים לחיים מאושרים. \n\nאני רוצה להפיק מהתכנית העמקה בתכנים שהחלתי להתעסק איתם בשנים האחרונות כמו מדיטציה, מיינדפולנס, ניהול קונפליקטים וניהול רגשי. בנוסף להעמיק בעולמות תוכן חדשים שטרם נתקלתי בהם. אני חושב שלעסוק בתכנים אלו תחת הדרכת אנשים מנוסים שלמדו את הענייין שנים רבות - זוהי פריווילגיה אדירה בעלת פוטנציאל חיובי גבוה מאוד. \nבנוסף אני מצפה לפעול במעגל של אנשים עם כוונות דומות, לפתח שיח מעמיק ולהיות מאותגר מדעות שונות ממני.","workType":"ראש הצופים במחנה אייזנר, מסאצ׳וסטס, ארה״ב. במקביל מתעסק בגיוס תרומות לעמותת ״לחיות בכבוד״ דרך הרשתות החברתיות.","globalOrIsrael":"ישראל","birthYear":2001}'::jsonb, ARRAY['PIF', 'עמותת יחידה', 'המעלה ה12', 'מחזור 2022']::text[]),
