-- =============================================================================
-- STEP 5: Insert people (skip if email already exists)
-- =============================================================================

INSERT INTO people (id, organization_id, first_name, last_name, email, phone, status, metadata, tags, created_at, updated_at)
SELECT
  gen_random_uuid(),
  '2542c6fe-3707-4dd8-abc5-bc70feac7e81',
  i.first_name,
  i.last_name,
  i.email,
  i.phone,
  'active',
  i.metadata,
  i.tags,
  NOW(),
  NOW()
FROM pif_import i
WHERE i.email IS NOT NULL
  AND NOT EXISTS (
    SELECT 1 FROM people p
    WHERE p.organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81'
      AND p.email = i.email
  );

-- Also insert people without email (using name to check duplicates)
INSERT INTO people (id, organization_id, first_name, last_name, email, phone, status, metadata, tags, created_at, updated_at)
SELECT
  gen_random_uuid(),
  '2542c6fe-3707-4dd8-abc5-bc70feac7e81',
  i.first_name,
  i.last_name,
  NULL,
  i.phone,
  'active',
  i.metadata,
  i.tags,
  NOW(),
  NOW()
FROM pif_import i
WHERE i.email IS NULL
  AND NOT EXISTS (
    SELECT 1 FROM people p
    WHERE p.organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81'
      AND p.first_name = i.first_name
      AND p.last_name = i.last_name
      AND p.email IS NULL
  );

-- =============================================================================
-- STEP 6: Create enrollments
-- =============================================================================

INSERT INTO enrollments (id, organization_id, person_id, program_id, cohort_id, status, enrolled_at, completed_at, created_at, updated_at)
SELECT
  gen_random_uuid(),
  '2542c6fe-3707-4dd8-abc5-bc70feac7e81',
  p.id,
  prog.id,
  c.id,
  'completed',
  (i.cohort_year || '-01-01')::timestamp,
  (i.cohort_year || '-12-31')::timestamp,
  NOW(),
  NOW()
FROM pif_import i
JOIN people p ON (
  p.organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81'
  AND (
    (i.email IS NOT NULL AND p.email = i.email)
    OR (i.email IS NULL AND p.first_name = i.first_name AND p.last_name = i.last_name AND p.email IS NULL)
  )
)
JOIN programs prog ON (prog.organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81' AND prog.name = 'PIF')
JOIN cohorts c ON (
  c.organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81'
  AND c.program_id = prog.id
  AND c.name = 'מחזור ' || i.cohort_year
)
WHERE i.cohort_year IS NOT NULL
  AND NOT EXISTS (
    SELECT 1 FROM enrollments e
    WHERE e.organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81'
      AND e.person_id = p.id
      AND e.program_id = prog.id
  );

-- =============================================================================
-- STEP 7: Cleanup and report
-- =============================================================================

-- Count results
DO $$
DECLARE
  v_people_count INT;
  v_enrollment_count INT;
BEGIN
  SELECT COUNT(*) INTO v_people_count
  FROM people WHERE organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81' AND 'PIF' = ANY(tags);

  SELECT COUNT(*) INTO v_enrollment_count
  FROM enrollments e
  JOIN programs p ON e.program_id = p.id
  WHERE e.organization_id = '2542c6fe-3707-4dd8-abc5-bc70feac7e81' AND p.name = 'PIF';

  RAISE NOTICE '========================================';
  RAISE NOTICE 'IMPORT COMPLETE';
  RAISE NOTICE '========================================';
  RAISE NOTICE 'PIF People in database: %', v_people_count;
  RAISE NOTICE 'PIF Enrollments in database: %', v_enrollment_count;
  RAISE NOTICE '========================================';
END $$;

-- Drop temp table
DROP TABLE pif_import;

-- Commit transaction
COMMIT;

